import React from 'react'
import EditForm from '../../Forms/EditForm'

const ShowEdit = (props) => {
  return (
    <div className="popup">
      <div className="popup\_inner">
        {props.filter(id => id.id === props.id)
        .map(identificator =>
            <EditForm id={identificator}/>
        )
        }
            </div>
    </div>
  );
};

export default ShowEdit
